import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Update import
import Navbar from "./navbar";

const Home = () => (
  <section id="home">
    <div>
        <p>DESIGNING</p>
      <h1>We Create Unique Architecture Design Ideas</h1>
      <button>Read More</button>
    </div>
  </section>
);

const Pages = () => (
  <section id="pages">
   <div>
        <p>pages</p>
      <h1>We Create Unique Architecture Design Ideas</h1>
      <button>Read More</button>
    </div>
  </section>
);

const Portfolio = () => (
  <section id="portfolio">
    {/* Your Portfolio section content */}
  </section>
);

const Services = () => (
  <section id="services">
    {/* Your Services section content */}
  </section>
);

const Blog = () => (
  <section id="blog">
    {/* Your Blog section content */}
  </section>
);

const ContactUs = () => (
  <section id="contact">
<div>
        <p>aaa</p>
      <h1>We Create Unique Architecture Design Ideas</h1>
      <button>Read More</button>
    </div>  </section>
);

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/pages" element={<Pages />} />
        <Route path="/portfolio" element={<Portfolio />} />
        <Route path="/services" element={<Services />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/contact" element={<ContactUs />} />
      </Routes>
    </Router>
  );
};

export default App;
